import './SummaryFooter.css'


function Motm(props) {

    let class1 = "summary_motm "+props.color+"2"
    let pic_path = '../images/' + props.motm + '.webp'
    let pic = import({pic_path})
    return (
        <div className={class1}>
            <img src={pic} alt={pic_path} className='mom_photo' />
        </div>
    )
}

function SummaryFooter(props) {

    let footer = props.footer
    let class1 = "summary_footer "+footer.tour
    let class2 = "match_result "+footer.result_color+"1"

    return (
        <div className={class1}>
            <div className={class2}>
                {footer.result}
            </div>
            <Motm color={footer.result_color} motm={footer.motm} motm_name={footer.motm_name}/>
        </div>
    )

    }
export default SummaryFooter;
